import React from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';

function Home() {
  const navigate = useNavigate();

  return (
    <>
      <Navbar />
      <section style={{
        background: `url('https://images.unsplash.com/photo-1521737604893-d14cc237f11d?ixlib=rb-4.0.3&auto=format&fit=crop&w=1950&q=80') center/cover no-repeat`,
        height: '90vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        textAlign: 'center',
        color: '#fff',
        padding: '0 5%'
      }}>
        <div>
          <h2 style={{ fontSize: '3rem', marginBottom: '1rem' }}>Learn New Skills from Industry Experts</h2>
          <p style={{ fontSize: '1.2rem', marginBottom: '2rem' }}>Join thousands of learners and mentors from across the globe.</p>
          <button
            onClick={() => navigate('/login')}
            style={{
              padding: '0.8rem 2rem',
              fontSize: '1rem',
              backgroundColor: '#ff7b54',
              border: 'none',
              borderRadius: '5px',
              color: '#fff',
              cursor: 'pointer'
            }}
          >
            Get Started
          </button>
        </div>
      </section>
    </>
  );
}

export default Home;
